(2, 342, 0, 'Stewart', 'Peddemors', 'stewartpeddemors@gmail.com', '$2a$10$WymzKFtvPipKn.u1bFUxgee7hpEnHI6P5jdkv6rUpzZGTzw4D/sTG', 'profile_23-7-2021_2158634_blob', '2021000341', 39, '1 Canada''s Wonderland Drive, Vaughan, ON L6A 1S6, Canada', '43.8430176', '-79.5394625', NULL, NULL, NULL, NULL, '9874563210', NULL, NULL, '923310fc-3268-4a0d-b807-b2217c66f28c', 'Yes', NULL, '98745777878', 'uxh', 'https://www.google.com/', 'https://www.google.com/', 'https://www.google.com/', 'https://www.google.com/', 'test', 'test', NULL, NULL, NULL, 'est', 'test', NULL, NULL, NULL, '2022-08-26 00:00:00.000', 0, 0, NULL, 'Stewart is a real estate leader who has been rewarded by his clients with many referrals and letters of recommendation. Stewart has been an industry leader and and had performed well during his time as a real estate agent. Getting to the life time achievement award and almost always at the top of the leaderboard in the office. Stewart has been in the top 10% of agent almost his whole carrier as he works at his craft and enjoys doing it. Client satisfaction is the number one goal as the more satisfied clients are the more referrals come his way. It is a pretty simple model that Stewart follows. Giving the right advice and updated timely advice is important to Stewart to make sure he is giving the best advice to his clients. Stewart is the team leader for the Peddemors Group. He and his team have topped the office many times and continue to lead the way.\n\n', 'I am an agent who can help you in your property search, as I am familiar with the ebbs and flows of this market.\n\n', '2021-08-26 08:18:55', '2021-10-05 16:58:08', 'google.com');
